import React from 'react';
import Header from '../components/header/header';

const Home = () => {
  return (
    <>
      <Header />
      <div>
        <h1>Welcome to the Home Page</h1>
        <p>This is the home page of the application.</p>
      </div>
    </>
  );
};

export default Home;
